import React from "react";
import Profile from "@mui/icons-material/AccountCircle";
import Search from "@mui/icons-material/Search";
import Home from "@mui/icons-material/Home";
import Movies from "@mui/icons-material/Movie";
// import icon from '../image/icon.png'
import icon from '../image/disney.png'

function sidebar() {
  return (
    <div className="grid grid-cols-2 bg-black h-screen w-28">
      <div >
        <img src={icon} className="ml-5 mt-5 w-40"/>
        <Profile className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
        <Search className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
        <Home className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
        <Movies className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
      </div>
      <div className="text-slate-300 z-20 ml-8 w-20 bg-black h-screen">
        <h4>My space</h4>
        <h4>Search</h4>
        <h4>Home</h4>
        <h4>Movie</h4>
      </div>
    </div>
  );
}

export default sidebar;
